import React from "react";
import PropTypes from "prop-types";

const ProfileAbout = ({
  profile: {
    bio,
    skills,
    user: { name }
  }
}) => {
  return <div></div>;
};

ProfileAbout.propTypes = {};

export default ProfileAbout;
